- GEOSITE,category-ai-!cn,默认代理
- GEOSITE,bing,DIRECT
- GEOSITE,microsoft@cn,DIRECT
- GEOIP,google,默认代理
- GEOIP,telegram,默认代理
- GEOIP,twitter,默认代理
